package com.gewen_01;

public class SwitchTest {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		String s = "gewen";
		switch (s) {
		case "fdf":
			System.out.println("fdf");
			break;
		case "gewen2":
			System.out.println("gewen2");
			break;
		case "gewen":
			System.out.println("gewen");
			break;
		default:
			System.out.println("other");
			break;
		}

	}

}
